void check_locate()
{
	string * name; 
	int * pos;
	int i, j, size, size2;
	int z;
	name = keys(Locate);
	size2 = sizeof(name);
	for (i=0;i<size2;i++)
	{
		pos = Locate[name[i]];
		size = sizeof(pos);
		for (j=0;j<size/2;j++)
		{
			if (get_valid_xy(to_int(name[i]), pos[2*j], pos[2*j+1], IS_CHAR_BLOCK)==0)
			{
log_file("checkstuff2.dat", sprintf("%s %d (%d,%d)\n", name[i], j+1, pos[2*j], pos[2*j+1]));								
			}
			if (get_block(to_int(name[i]), pos[2*j], pos[2*j+1])&IS_MAP_BLOCK) 
			{
log_file("checkstuff.dat", sprintf("%s %d (%d,%d)\n", name[i], j+1, pos[2*j], pos[2*j+1]));				
			}
		}
	}
}